CKEDITOR.plugins.setLang("a11yhelp","fr",{title:"Instructions d'accessibilit\xe9",contents:"Contenu de l'aide. Pour fermer cette fen\xeatre, appuyez sur la touche \xc9chap.",legend:[{name:"G\xe9n\xe9ral",items:[{name:"Barre d'outils de l'\xe9diteur",legend:"Appuyer sur ${toolbarFocus} pour acc\xe9der \xe0 la barre d'outils. Se d\xe9placer vers le groupe suivant ou pr\xe9c\xe9dent de la barre d'outils avec les touches Tab et Maj+Tab. Se d\xe9placer vers le bouton suivant ou pr\xe9c\xe9dent de la barre d'outils avec les touches Fl\xe8che droite et Fl\xe8che gauche. Appuyer sur la barre d'espace ou la touche Entr\xe9e pour activer le bouton de barre d'outils."},{name:"Fen\xeatre de l'\xe9diteur",legend:"Dans une bo\xeete de dialogue, appuyer sur Tab pour passer \xe0 l'\xe9l\xe9ment suivant, appuyer sur Maj+Tab pour passer \xe0 l'\xe9l\xe9ment pr\xe9c\xe9dent, appuyer sur Entr\xe9e pour valider, appuyer sur \xc9chap pour annuler. Quand une bo\xeete de dialogue poss\xe8de des onglets, la liste peut \xeatre atteinte avec Alt+F10 ou avec Tab. Dans la liste des onglets, se d\xe9placer vers le suivant et le pr\xe9c\xe9dent avec les touches Fl\xe8che droite et Fl\xe8che gauche respectivement."},{name:"Menu contextuel de l'\xe9diteur",legend:"Appuyer sur ${contextMenu} ou sur la touche Menu pour ouvrir le menu contextuel. Se d\xe9placer ensuite vers l'option suivante du menu avec les touches Tab ou Fl\xe8che bas. Se d\xe9placer vers l'option pr\xe9c\xe9dente avec les touches Maj+Tab ou Fl\xe8che haut. Appuyer sur la barre d'espace ou la touche Entr\xe9e pour s\xe9lectionner l'option du menu. Appuyer sur la barre d'espace, la touche Entr\xe9e ou Fl\xe8che droite pour ouvrir le sous-menu de l'option s\xe9lectionn\xe9e. Revenir \xe0 l'\xe9l\xe9ment de menu parent avec la touche \xc9chap ou Fl\xe8che gauche. Fermer le menu contextuel avec \xc9chap."},{name:"Zone de liste de l'\xe9diteur",legend:"Dans une liste en menu d\xe9roulant, se d\xe9placer vers l'\xe9l\xe9ment suivant de la liste avec les touches Tab ou Fl\xe8che bas. Se d\xe9placer vers l'\xe9l\xe9ment pr\xe9c\xe9dent de la liste avec les touches Maj+Tab ou Fl\xe8che haut. Appuyer sur la barre d'espace ou sur Entr\xe9e pour s\xe9lectionner l'option dans la liste. Appuyer sur \xc9chap pour fermer le menu d\xe9roulant."},{name:"Barre du chemin d'\xe9l\xe9ments de l'\xe9diteur",legend:"Appuyer sur ${elementsPathFocus} pour naviguer vers la barre du fil d'Ariane des \xe9l\xe9ments. Se d\xe9placer vers le bouton de l'\xe9l\xe9ment suivant avec les touches Tab ou Fl\xe8che droite. Se d\xe9placer vers le bouton pr\xe9c\xe9dent avec les touches Maj+Tab ou Fl\xe8che gauche. Appuyer sur la barre d'espace ou sur Entr\xe9e pour s\xe9lectionner l'\xe9l\xe9ment dans l'\xe9diteur."}]},{name:"Commandes",items:[{name:" Annuler la commande",legend:"Appuyer sur ${undo}"},{name:"Commande restaurer",legend:"Appuyer sur ${redo}"},{name:" Commande gras",legend:"Appuyer sur ${bold}"},{name:" Commande italique",legend:"Appuyer sur ${italic}"},{name:" Commande soulign\xe9",legend:"Appuyer sur ${underline}"},{name:" Commande lien",legend:"Appuyer sur ${link}"},{name:" Commande enrouler la barre d'outils",legend:"Appuyer sur ${toolbarCollapse}"},{name:"Commande d'acc\xe8s \xe0 l'\xe9l\xe9ment s\xe9lectionnable pr\xe9c\xe9dent",legend:"Appuyer sur ${accessNextSpace} pour acc\xe9der \xe0 l'\xe9l\xe9ment s\xe9lectionnable inatteignable le plus proche avant le curseur, par exemple\xa0: deux lignes horizontales adjacentes. R\xe9p\xe9ter la combinaison de touches pour atteindre les \xe9l\xe9ments s\xe9lectionnables pr\xe9c\xe9dents."},{name:"Commande d'acc\xe8s \xe0 l'\xe9l\xe9ment s\xe9lectionnable suivant",legend:"Appuyer sur ${accessNextSpace} pour acc\xe9der \xe0 l'\xe9l\xe9ment s\xe9lectionnable inatteignable le plus proche apr\xe8s le curseur, par exemple\xa0: deux lignes horizontales adjacentes. R\xe9p\xe9ter la combinaison de touches pour atteindre les \xe9l\xe9ments s\xe9lectionnables suivants."},{name:" Aide sur l'accessibilit\xe9",legend:"Appuyer sur ${a11yHelp}"},{name:"Coller comme texte sans mise en forme",legend:"Appuyer sur ${pastetext}",legendEdge:"Press ${pastetext}, followed by ${paste}"}]}],tab:"Tabulation",pause:"Pause",capslock:"Verr. Maj.",escape:"\xc9chap",pageUp:"Page sup\xe9rieure",pageDown:"Page suivante",leftArrow:"Fl\xe8che gauche",upArrow:"Fl\xe8che haut",rightArrow:"Fl\xe8che droite",downArrow:"Fl\xe8che basse",insert:"Inser",leftWindowKey:"Touche Windows gauche",rightWindowKey:"Touche Windows droite",selectKey:"Touche S\xe9lectionner",numpad0:"0 du pav\xe9 num\xe9rique",numpad1:"1 du pav\xe9 num\xe9rique",numpad2:"2 du pav\xe9 num\xe9rique",numpad3:"3 du pav\xe9 num\xe9rique",numpad4:"4 du pav\xe9 num\xe9rique",numpad5:"5 du pav\xe9 num\xe9rique",numpad6:"6 du pav\xe9 num\xe9rique",numpad7:"7 du pav\xe9 num\xe9rique",numpad8:"Pav\xe9 num\xe9rique 8",numpad9:"9 du pav\xe9 num\xe9rique",multiply:"Multiplier",add:"Plus",subtract:"Moins",decimalPoint:"Point d\xe9cimal",divide:"Diviser",f1:"F1",f2:"F2",f3:"F3",f4:"F4",f5:"F5",f6:"F6",f7:"F7",f8:"F8",f9:"F9",f10:"F10",f11:"F11",f12:"F12",numLock:"Verr. Num.",scrollLock:"Arr\xeat d\xe9fil.",semiColon:"Point-virgule",equalSign:"Signe \xe9gal",comma:"Virgule",dash:"Tiret",period:"Point",forwardSlash:"Barre oblique",graveAccent:"Accent grave",openBracket:"Parenth\xe8se ouvrante",backSlash:"Barre oblique inverse",closeBracket:"Parenth\xe8se fermante",singleQuote:"Apostrophe"});